import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  const navbarStyle = {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#1976d2",
    padding: "0.5rem 1rem",
  };

  const navLinksStyle = {
    display: "flex",
    gap: "1rem",
  };

  const linkStyle = {
    color: "#fff",
    textDecoration: "none",
    fontWeight: "500",
  };

  return (
    <nav style={navbarStyle}>
      {/* לוגו / שם האתר */}
      <div style={{ color: "#fff", fontSize: "1.25rem", fontWeight: "bold" }}>
        AI Voice Chat
      </div>

      {/* קישורים */}
      <div style={navLinksStyle}>
        <Link to="/" style={linkStyle}>
          Home
        </Link>
        <Link to="/chat" style={linkStyle}>
          Chat
        </Link>
        <Link to="/about" style={linkStyle}>
          About
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
